    private readonly ISudokuEngine _brutalSimiplicityEngine = new SudokuEngineBrutalSimplicity();
    private readonly ISudokuEngine _engineDP = new SimpleEngineDP();

    [Benchmark(Baseline = true)]
    public async Task Brutalsimplicity()
    {
      foreach(Tuple<string, string> t in _puzzles)
      {
        await _brutalSimiplicityEngine.SolveAsync(t.Item1).ConfigureAwait(false);
      }
    }

    [Benchmark]
    public async Task DPEngine()
    {
      foreach(Tuple<string, string> t in _puzzles)
      {
        await _engineDP.SolveAsync(t.Item1).ConfigureAwait(false);
      }
    }

    public async Task Debug()
    {
      try
      {
        ISudokuEngine brutalSimiplicityEngine = new SudokuEngineBrutalSimplicity();
        ISudokuEngine engineDP = new SimpleEngineDP();

        long max = 0;
        long start;
        long end;
        double avg = 0.0;
        Stopwatch watch = new();
        watch.Start();

        for(int i = 0; i < 1; i++)
        {
          start = watch.ElapsedMilliseconds;
          await TestSudokuEngineAsync(brutalSimiplicityEngine, "BrutalSimplicityEngine").ConfigureAwait(false);
          end = watch.ElapsedMilliseconds;

          Console.WriteLine(end - start);
          max = ((end - start) > max) ? (end - start) : max;
          avg += end - start;
        }
        Console.WriteLine("Max: {0}ms", max);
        Console.WriteLine("Avg: {0}ms", avg / _puzzles.Count);

        max = 0;
        avg = 0;
        for(int i = 0; i < 1; i++)
        {
          start = watch.ElapsedMilliseconds;
          await TestSudokuEngineAsync(engineDP, "SimpleEngineDP").ConfigureAwait(false);
          end = watch.ElapsedMilliseconds;

          Console.WriteLine(end - start);
          max = ((end - start) > max) ? (end - start) : max;
          avg += end - start;
        }
        Console.WriteLine("Max: {0}ms", max);
        Console.WriteLine("Avg: {0}ms", avg / _puzzles.Count);
      }
      catch(Exception ex)
      {
        Console.WriteLine($"Error, msg: {ex.Message}, stacktrace: {ex.StackTrace}");
      }
    }
    private async Task TestSudokuEngineAsync(ISudokuEngine engine, string name)
    {
      Console.WriteLine($"----------------------------------------------");
      Console.WriteLine($"{name}");
      Console.WriteLine($"----------------------------------------------");

      Tuple<bool, string> solvedReturn;
      foreach(Tuple<string, string> t in _puzzles)
      {
        solvedReturn = await engine.SolveAsync(t.Item1).ConfigureAwait(false);
        if(solvedReturn.Item1 == true)
        {
          if(t.Item2.Equals(solvedReturn.Item2) == true)
          {
            //Console.WriteLine($"SOLVED");
          }
          else
          {
            Console.WriteLine($"Problem: solver think it solved the puzzle but it's wrong");
          }
        }
        else
        {
          Console.WriteLine($"Solver did not solved the puzzle");
        }
      }
    }
  }
